contract WorldHeritageBase is WorldHeritageAccessControl {
    using SafeMath for SafeMath;

    uint promoCreatedCount;
    /// @dev The NewWorldHeritage event is fired whenever a new worldheritage comes into existence.
    event NewWorldHeritage(uint tokenId,string name, address _address);

    /// @dev Transfer event as defined in current draft of ERC721. 
    ///  ownership is assigned.
    event Transfer(address from, address to, uint256 tokenId);

    function WorldHeritageBase() {
        // constructor  构造函数
    }

    //define structs
    struct WorldHeritage {
        string name;
    }
    //dynamic Array
    WorldHeritage[] public worldheritages;  

    /**mapping**/
    mapping (uint256 => address) public IndexToOwner;
    mapping (address => uint256) ownershipTokenCount;
    mapping (uint256 => uint256) IndexToPrice;
    mapping (uint256 => address) public IndexToApproved;

     /// Check for token ownership
  modifier onlyOwnerOf(uint _tokenId) {
    require(msg.sender == IndexToOwner[_tokenId]);
    _;
  }

    /// For creating promos
    function _createPromos(string _name, address _owner, uint256 _price) internal returns(uint) {

    WorldHeritage memory _worldheritage = WorldHeritage({
      name: _name
    });
    uint256 newTokenId = worldheritages.push(_worldheritage) - 1;

    // It's probably never going to happen, 4 billion tokens are A LOT, but
    // let's just be 100% sure we never let this happen.
    require(newTokenId == uint256(uint32(newTokenId)));
    //event
    NewWorldHeritage(newTokenId, _name, _owner);

    IndexToPrice[newTokenId] = _price;

    // This will assign ownership, and also emit the Transfer event as
    // per ERC721 draft
    _transfer(address(0), _owner, newTokenId);
    return newTokenId;
  }

  /// @dev Assigns ownership of a specific worldheritage to an address.
  function _transfer(address _from, address _to, uint256 _tokenId) internal {
    // Since the number of persons is capped to 2^32 we can't overflow this
    ownershipTokenCount[_to] = SafeMath.add(ownershipTokenCount[_to],1);
    //transfer ownership
    IndexToOwner[_tokenId] = _to;

    // When creating new worldheritage _from is 0x0, but we can't account that address.
    if (_from != address(0)) {
      ownershipTokenCount[_from] = SafeMath.sub(ownershipTokenCount[_from],1);
      // clear any previously approved ownership exchange
      delete IndexToApproved[_tokenId];
    }
    // Emit the transfer event.
    Transfer(_from, _to, _tokenId);
  }
}

/// @title 实现ERC721 接口
/// @author rainysiu
/// @dev the worldheritageownership 
contract WorldHeritageOwnership is WorldHeritageBase, ERC721 {

 //using SafeMath for uint256;
 /*** CONSTANTS ***/
  /// @notice Name and symbol of the non fungible token, as defined in ERC721.
  string public constant NAME = "CryptoWorldHeritage"; // solhint-disable-line
  string public constant SYMBOL = "WorldHeritageToken"; // solhint-disable-line

  //mapping (uint => address) zombieApprovals;

  function balanceOf(address _owner) public view returns (uint256 _balance) {
    return ownershipTokenCount[_owner];
  }

  function ownerOf(uint256 _tokenId) public view returns (address _owner) {
    return IndexToOwner[_tokenId];
  }

  function transfer(address _to, uint256 _tokenId) public onlyOwnerOf(_tokenId) {
    _transfer(msg.sender, _to, _tokenId);
  }

    /// Third-party initiates transfer of token from address _from to address _to
  /// @param _from The address for the token to be transferred from.
  /// @param _to The address for the token to be transferred to.
  /// @param _tokenId The ID of the Token that can be transferred if this call succeeds.
  /// @dev Required for ERC-721 compliance.
  /*function transferFrom(address _from, address _to, uint256 _tokenId) public onlyOwnerOf(_tokenId) onlyApproved(_to, _tokenId) addressNotNull(_to) {
    _transfer(_from, _to, _tokenId);
  }*/

  function transferFrom(address _from, address _to, uint256 _tokenId) public onlyOwnerOf(_tokenId) {
    //require(_owns(_from, _tokenId));
    //require(_approved(_to, _tokenId));
    require(IndexToApproved[_tokenId] == _to);
    require(_to != address(0));

    _transfer(_from, _to, _tokenId);
  }


  function approve(address _to, uint256 _tokenId) public onlyOwnerOf(_tokenId) {
    IndexToApproved[_tokenId] = _to;
    Approval(msg.sender, _to, _tokenId);
  }

  function takeOwnership(uint256 _tokenId) public {
    require(IndexToApproved[_tokenId] == msg.sender);
    address owner = ownerOf(_tokenId);
    _transfer(owner, msg.sender, _tokenId);
  }

  function name() public view returns (string _name) {
    return NAME;
  }

  function symbol() public view returns (string _symbol) {
    return SYMBOL;
  }

   function implementsERC721() public pure returns (bool) {
    return true;
  }
    /// For querying totalSupply of token
  /// @dev Required for ERC-721 compliance.
  function totalSupply() public view returns (uint256 total) {
    return worldheritages.length;
  }

}

contract WorldHeritageCore is WorldHeritageOwnership {
  using SafeMath16 for SafeMath16;
    /// @dev The TokenSold event is fired whenever a token is sold.
  event BuyToken(uint256 tokenId, uint256 oldPrice, uint256 newPrice, address prevOwner, address winner, string name);

  /*** CONSTANTS ***/
  uint256 private constant PROMO_CREATION_LIMIT = 1073;
  uint16 public promoCreatedCount;

  uint256 private startingPrice = 0.001 ether;
  uint256 private firstStepLimit =  0.053613 ether;
  uint256 private secondStepLimit = 0.564957 ether;


  /*** CONSTRUCTOR ***/
  function WorldHeritageCore() public {
    ceoAddress = msg.sender;
    cooAddress = msg.sender;
  }

      /// @notice No tipping!
    /// @dev Reject all Ether from being sent here, unless it's from one of the
    ///  two auction contracts. (Hopefully, we can prevent user accidents.)
    function() external payable {
    }

  /// @dev Creates a new promo worldheritage with the given name, with given _price and assignes it to an address.
    function createPromos(string _name, address _address, uint _price) internal onlyCOO returns (uint256) {
        require(promoCreatedCount < PROMO_CREATION_LIMIT); //总量固定
        if (_address == address(0)) {
            _address = cooAddress;
        }
        if (_price <= 0) {
            _price = startingPrice;
        }
        promoCreatedCount = SafeMath16.add(promoCreatedCount,1);
        _createPromos(_name, _address, _price);
        return promoCreatedCount;
    }


  /// @notice Returns all the relevant information about a specific tokenId.
  /// @param _tokenId The tokenId of the worldheritage.
  function getWorldHeritage(uint256 _tokenId) public view returns (
    string tokenName,
    uint256 sellingPrice,
    address owner
  ) {
    WorldHeritage storage worldheritage = worldheritages[_tokenId];
    tokenName = worldheritage.name;
    sellingPrice = IndexToPrice[_tokenId];
    owner = IndexToOwner[_tokenId];
  }

  function getWorldHeritageCount() public view returns(uint16) {
      return promoCreatedCount;
  }


  // Allows someone to send ether and obtain the token
  function purchase(uint256 _tokenId) external payable {
    address oldOwner = IndexToOwner[_tokenId];
    address newOwner = msg.sender;

    uint256 sellingPrice = IndexToPrice[_tokenId];

    // Making sure token owner is not sending to self
    require(oldOwner != newOwner);

    // Safety check to prevent against an unexpected 0x0 default.
    require(newOwner != address(0));

    // Making sure sent amount is greater than or equal to the sellingPrice
    require(msg.value >= sellingPrice);

    uint256 payment = uint256(SafeMath.div(SafeMath.mul(sellingPrice, 93), 100)); //手续费
    uint256 purchaseExcess = SafeMath.sub(msg.value, sellingPrice); //卖家收到的钱

    // Update prices
    if (sellingPrice < firstStepLimit) {
      // first stage
      IndexToPrice[_tokenId] = SafeMath.div(SafeMath.mul(sellingPrice, 200), 93);
    } else if (sellingPrice < secondStepLimit) {
      // second stage
      IndexToPrice[_tokenId] = SafeMath.div(SafeMath.mul(sellingPrice, 120), 93);
    } else {
      // third stage
      IndexToPrice[_tokenId] = SafeMath.div(SafeMath.mul(sellingPrice, 115), 93);
    }

    _transfer(oldOwner, newOwner, _tokenId);

    // Pay previous tokenOwner if owner is not contract
    if (oldOwner != address(this)) {
      oldOwner.transfer(payment); //(1-0.07)
    }
    //event 
    BuyToken(_tokenId, sellingPrice, IndexToPrice[_tokenId], oldOwner, newOwner, worldheritages[_tokenId].name);

    msg.sender.transfer(purchaseExcess);
  }


   /// @dev Creates a new Worldheritage with the given name.
  function createWorldHeritage(string _name) public onlyCOO {
    _createPromos(_name, address(this), startingPrice);
  }

  function priceOf(uint256 _tokenId) public view returns (uint256 price) {
    return IndexToPrice[_tokenId];
  }

  /// @param _owner The owner whose celebrity tokens we are interested in.
  /// @dev This method MUST NEVER be called by smart contract code. First, it's fairly
  ///  expensive (it walks the entire Persons array looking for persons belonging to owner),
  ///  but it also returns a dynamic array, which is only supported for web3 calls, and
  ///  not contract-to-contract calls.
  function tokensOfOwner(address _owner) public view returns(uint256[] ownerTokens) {
    uint256 tokenCount = balanceOf(_owner);
    if (tokenCount == 0) {
        // Return an empty array
      return new uint256[](0);
    } else {
      uint256[] memory result = new uint256[](tokenCount);
      uint256 totalWorldHeritages = totalSupply();
      uint256 resultIndex = 0;

      uint256 tokenId;
      for (tokenId = 0; tokenId <= totalWorldHeritages; tokenId++) {
        if (IndexToOwner[tokenId] == _owner) {
          result[resultIndex] = tokenId;
          resultIndex++;
        }
      }
      return result;
    }
  }
}

